function loadFrames(data, seq) {
    // load frames from data: nested array of hel pars 
    var sequence = (seq || null);
    var parsed = parseFrames(data);
    var frames = parsed[0];
    var nsteps = parsed[1];
    var nstrand = parsed[2];
    var nbp = parsed[3];
    if(nstrand == 1) {		// RBP
	log("Building RBP."); 
	if(nsteps > 1)
	    movieRbp(sequence, nstrand, nbp,  frames); 
	else
	    buildRbp(sequence, nstrand, nbp,  frames[0]);
    }else if(nstrand == 2) {	// RB
	log("Building RB.");
	if(nsteps > 1)
	    movieRb(sequence, nstrand, nbp,  frames);
	else
	    buildRb(sequence, nstrand, nbp,  frames[0]);
    }else{
	console.log("Wrong number of strands "+nstrand+".");
    }
}

function parseFrames(data) {
    // parse data (nested array of hel pars) to frames[] structure
    var ret = [];
    var frames;
    var numStrands = Math.max.apply(Math, _mcol(data, 0))*1000;
    var nbp = Math.max.apply(Math, _mcol(data, 1))*1000;
    var nsteps = 0;
    var i = 0;
    console.log("PARSING: ("+numStrands+" strands, "+nbp+" bp)");
    while(i<data.length) {
	frames = [];
	for(var ii=0; ii<nbp; ii++) // init
	    frames.push([]);
	for(var s=0; s<numStrands; s++) {
	    for(var ii=0; ii<nbp; ii++) {
		if(data[i][0]*1000 != s+1) {
		    nbp --;
		    continue;
		}
		frames[ii].push(_mpr2(data[i].slice(2, 11), data[i].slice(11, 14)));
		i++;
		// var tmp = frames[ii][frames[ii].length -1];
		// tmp.setPosition(tmp.getPosition().addSelf(_v(10,0,0)));
		// frames[ii][frames[ii].length -1].setPosition(_v(0,0,0));
	    }
	}
	ret.push(frames);
	nsteps ++;
    }
    log("PARSE: "+nsteps+" frames found ("+numStrands+" strands, "+nbp+" bp)");
    return [ret, nsteps, numStrands, nbp];
}

function DATToArray(dataString) {
    // Convert dat file to array
    var data = [[]];
    var objPattern = new RegExp("( *)([-+0-9.]+) *(\\r?\\n|\\r$)?","gi");
    var match = null;
    
    while (match = objPattern.exec( dataString )) {
	data[data.length-1].push(match[2]/1000); // move to parseing
	if(match[3] && ( match[3][0] == "\n" || match[3][0] == "\r"))
	    data.push([]);
    }
    log("DAT: found "+(data.length-1)+"x"+data[0].length);
    return data.slice(0, data.length-1);
};

